import React, { useState } from "react";

function Skaiciavimai() {
  const [sk1, setSk1] = useState(""); // State for first number
  const [sk2, setSk2] = useState(""); // State for second number
  const [suma, setSuma] = useState(0); // State for sum
  const [sandauga, setSandauga] = useState(0); // State for product

  const skaiciuoti = () => {
    const num1 = Number(sk1);
    const num2 = Number(sk2);

    setSuma(num1 + num2); // Update sum state
    setSandauga(num1 * num2); // Update product state
  };

  return (
    <>
      <h2>Tai yra skaiciavim킬 puslapis</h2>
      <hr />
      <input
        type="text"
        placeholder="Pirmas skai훾ius"
        value={sk1}
        onChange={(e) => setSk1(e.target.value)} // Update state on input change
      />
      <br />
      <input
        type="text"
        placeholder="Antras skai훾ius"
        value={sk2}
        onChange={(e) => setSk2(e.target.value)} // Update state on input change
      />
      <br />
      <button onClick={skaiciuoti}>Skai훾iuoti</button>
      <div>Suma: {suma}</div> {/* Display sum */}
      <div>Sandauga: {sandauga}</div> {/* Display product */}
    </>
  );
}

export default Skaiciavimai;
